import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function WelcomeScreen() {
  const navigate = useNavigate();

  return (
    <div className="tactical-bg cursor-reticle relative min-h-screen w-full flex flex-col justify-between items-center text-[var(--color-gloss-white)] font-sans overflow-hidden">
      {/* Animated background gradient */}
      <div className="bg-animated-gradient" />

      {/* Top Bar */}
      <div className="w-full flex justify-between items-start px-8 pt-8 text-base font-medium text-[var(--color-cool-gray)] z-10">
        <span>Careers (2)</span>
        <span>Get in touch</span>
      </div>

      {/* Centered Hero Content */}
      <div className="flex-1 flex flex-col items-center justify-center z-10">
        <div className="ares-hero-container" style={{position: 'relative', zIndex: 3, paddingTop: '2.5em', paddingBottom: '2.5em'}}>
          <div className="hero-tactical-row">
            <div className="hero-ares-tactical">ARES</div>
            <div className="hero-terminal-tactical">TRADING TERMINAL</div>
          </div>
          <div className="hero-subline-tactical">The Meme Coin DeFi Exchange</div>
          <button
            className="hero-btn-tactical"
            onClick={() => navigate('/feed')}
          >
            ENTER
            <span className="blinking-cursor">_</span>
            <span className="flicker-underline"></span>
          </button>
        </div>
        <div className="hero-meta-row">↘ Careers · Platform updates · Stealth alerts</div>
      </div>

      {/* Bottom Center */}
      <div className="w-full flex justify-center items-end pb-8 text-[var(--color-cool-gray)] text-base font-medium z-10">
        <span>Our Products</span>
      </div>
    </div>
  );
}
